function countInversions(arr) {
  let counter = 0;
  function Sort2Array(left, rigth) {
    let arrayConcat = [];
    while (left.length && rigth.length) {
      let fristElemet;
      if (left[0] <= rigth[0]) {
        fristElemet = left.shift();
      } else {
        counter += left.length;
        fristElemet = rigth.shift();
      }
      arrayConcat.push(fristElemet);
    }
    arrayConcat = arrayConcat.concat(left).concat(rigth);
    return arrayConcat;
  }

  function SortArr(arr) {
    if (arr.length === 1) {
      return arr;
    }
    const midArray = arr.length / 2;
    const left = arr.splice(0, midArray);
    const rigth = arr;
    const leftSort = SortArr(left);
    const rigthSort = SortArr(rigth);
    return Sort2Array(leftSort, rigthSort);
  }
  arr = SortArr(arr);
  return counter;
}

